import React from "react";
import { ScrollSyle } from "./ScrollSyle";

const Scroll = props => {

    return (

        <ScrollSyle>
            <img className="scroll" src="/static/svg/scroll.svg" />

        </ScrollSyle>
    )

}

export default Scroll;
